import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom"
import Header from './components/Header'
import routes from './routes'

const App: React.FC = () => {
  return (
    <>
      <Header favcol="yellow" />
      <Router>
        <Switch>
          {routes.map((route, i) => (
            <Route
              key={i}
              path={route.path}
              render={props => (
                // pass the sub-routes down to keep nesting: routes={route.routes}
                <route.component {...props} />
              )}
            />
          ))}
        </Switch>
      </Router>
    </>
  )
}

export default App
